@-moz-document regexp('https://airtable\\.com/app(kFwqZCU6MFquJh|3zcIEKG2BbtWTp|ykJfdEoEmZYNjS)/pag.+') {
.ql-editor {
  text-align: right !important;
  direction: rtl !important;
}

.ql-editor li {
  margin-right: 24px;
  margin-left: 0;
}
.ql-editor li::before {
	left: auto;
  right: -24px;
}
  

[id=pageNavigationList] {
  display: none;
}



[data-elementtype="rowSelector"] {
  display: none;
}

[data-elementtype="button"] [role="link"] .flex {
  flex-direction: row-reverse;
}

[data-elementtype="button"] .flex p + div > svg {
  transform: scalex(-100%);

}




}
